  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Okefenokee National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1942. The report begins by summarizing the weather conditions, water conditions,
  food and cover, and wildfires during this period. Wildlife -including migratory
  birds, upland game birds, big animals, furbearers, predators, rodents, raptors,
  fish, and disease-  is also covered. The public relations section of the report
  describes recreational uses, Refuge visitors, Refuge partcipation, and violations.
  N-R forms and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
